import React from 'react';

const categories = [
    { id: 1, name: "All", image: "/all.jpg" },
    { id: 2, name: "Biryani", image: "/jk.jpg" },
    { id: 3, name: "Pizza", image: "/pizza.jpg" },
    { id: 4, name: "Burgers", image: "/burger.jpeg" },
    { id: 5, name: "Pasta", image: "/pasta.jpg" },
    { id: 6, name: "Cake", image: "/cake.jpg" },
    { id: 7, name: "Chai", image: "/chai.jpg" },
    { id: 8, name: "Sandwiches", image: "/sandwich.jpg" }
];

export default function FoodCategories() {
    return (
        <div style={{ display: "flex", justifyContent: "space-around", flexWrap: "wrap", padding: "20px" }}>
            {categories.map((category) => (
                <div key={category.id} style={{ width: "150px", textAlign: "center", margin: "10px" }}>
                    <img src={category.image} alt={category.name} style={{ width: "100%", height: "100px", objectFit: "cover", borderRadius: "10px" }} />
                    <h5 style={{ marginTop: "10px" }}>{category.name}</h5>
                </div>
            ))}
        </div>
    );
}
